import React,{Component} from "react";
import {MDBBtn, MDBCol, MDBContainer, MDBDataTable, MDBRow} from "mdbreact";

class AllExpanses extends Component{
    state = {
        data: {
            columns: [
                {
                    label: '#',
                    field: 'id',
                    sort: 'asc',
                    width: 100
                },
                {
                    label: 'Description',
                    field: 'Expanse_Desc',
                    sort: 'asc',
                    width: 420
                },
                {
                    label: 'Amount',
                    field: 'Expanse_Amount',
                    sort: 'asc',
                    width: 200
                },
            ],
            rows: []
        },
        grossProfit: 0
    };

    render() {
        let { columns, rows } = this.state.data;
        return (
            <div>
                <MDBDataTable
                    theadColor={"blue-gradient"}
                    striped
                    barReverse={true}
                    theadTextWhite={true}
                    hover
                    noBottomColumns={true}
                    data={{columns,rows}}
                />
            </div>
        );
    }
}

export default AllExpanses;
